import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import linkedIn from './assets/linkedin.png';

function Navbar() {
  return (
    <nav className="navbar">
      <Link to="/" className="navbar-logo">home</Link>
      <div className="navbar-links">
        <a href="www.linkedin.com/in/alyssaranastasi" target="_blank" rel="noopener noreferrer">
          <img src={linkedIn} alt="LinkedIn Logo" className="navbar-logo" />
        </a>
        {/* <a href="https://github.com/your-profile" target="_blank" rel="noopener noreferrer">
          <img src={githubLogo} alt="GitHub Logo" className="navbar-logo" />
        </a>
        <a href="https://twitter.com/your-profile" target="_blank" rel="noopener noreferrer">
          <img src={twitterLogo} alt="Twitter Logo" className="navbar-logo" />
        </a> */}
      </div>
    </nav>
  );
}

export default Navbar;
